import { Component, OnInit } from '@angular/core';
import { Store } from '@ngrx/store';
import { actions } from 'src/app/providers/todos.actions';
import { todoSelector } from 'src/app/providers/todos.reducers';
import { TodoModel } from 'src/app/providers/todos.states';

@Component({
  selector: 'app-todo-input',
  templateUrl: './todo-input.component.html',
  styleUrls: ['./todo-input.component.scss']
})
export class TodoInputComponent implements OnInit {
  todoInput?: string;
  todos?: TodoModel[];

  constructor(private store: Store) { }

  ngOnInit(): void {
    this.store.select(todoSelector).subscribe(state => this.todos = state)
  }

  addTodo() {
    if(this.todoInput!.trim().length > 0)
    this.store.dispatch(actions.addTodoAction({
      id: this.todos!.length + 1,
      completed: false,
      title: this.todoInput!.trim(),
    }));
    this.todoInput = '';
  }

}

import { Component, Input, OnInit } from '@angular/core';
import { Store } from '@ngrx/store';
import { actions } from 'src/app/providers/todos.actions';
import { TodoModel } from 'src/app/providers/todos.states';

@Component({
  selector: 'app-todo-item',
  templateUrl: './todo-item.component.html',
  styleUrls: ['./todo-item.component.scss'],
})
export class TodoItemComponent implements OnInit {
  @Input() todo?: TodoModel;
  editTodo: boolean = false;
  completedTodo: boolean = false;
  todoInput?: string;

  constructor(private store: Store) {}

  ngOnInit(): void {
    this.completedTodo = this.todo!.completed;
    this.todoInput = this.todo?.title;
  }

  updateToggle() {
    this.editTodo = !this.editTodo;
  }

  updateTodo() {
    this.editTodo = !this.editTodo;
    if (this.todoInput!.trim().length > 0)
      this.store.dispatch(
        actions.updateTodoAction({
          id: this.todo!.id,
          completed: this.todo!.completed,
          title: this.todoInput!.trim(),
        })

      );
      else {
        this.todoInput = this.todo!.title;
      }
  }

  completeToggle() {
    this.completedTodo = !this.completedTodo;
    this.store.dispatch(
      actions.updateTodoAction({
        id: this.todo!.id,
        completed: !this.todo!.completed,
        title: this.todoInput!,
      })
    );
  }

  deleteTodo() {
    this.store.dispatch(
      actions.deleteTodoAction({
        id: this.todo!.id,
        completed: this.todo!.completed,
        title: this.todo!.title,
      })
    );
  }
}

import { Component, OnInit } from '@angular/core';
import { Store } from '@ngrx/store';
import { todoSelector } from 'src/app/providers/todos.reducers';
